import React from 'react';

import ReactDom from 'react-dom';

let date = new Date();
let dat = date.getHours();
let da = date.getMinutes();


ReactDom.render(
  <h1>Hello Sir, Good Morning ({dat}:{da})</h1>,
  document.getElementById('root')
);
